        <div className='container'>
            <Card title={"O que estamos fazendo para ajudar o seu negócio"} index={"1"}  titleButton={"VER MAIS"} textList={["Durante todo o período de quarentena, estamos à total disposição de cada um de vocês, clientes.O COVID-19 chegou desestabilizando o país e trazendo consigo uma grande incógnita quanto a proporção disso no país, nas pessoas e principalmente, na economia.", "Nosso compromisso com você durante essa fase, é para assegurar que o seu negócio seja o  menos afetado possível, mantendo sua base de clientes fidelizados sólida e segura!"]} nameImage={"image8.png"}/>

            <Card title={"Ferramentas indispensáveis nesse momento"} index={"2"}  titleButton={"CONHEÇA AGORA O QUE ESTÁ A SUA DISPOSIÇÃO"} textList={["Você sabe que magos contam com bons artifícios para fazer sua magia acontecer. Com nós FideWizards não é diferente!", "Contamos com ferramentas poderosas para fazer nossa mágica acontecer e fidelizar seus clientes. Especialmente neste período em que o COVID-19 nos pegou desprevenidos, vamos compartilhar com você nossas ferramentas e fórmulas mágicas, afinal, queremos ver o seu negócio se destacando e superando essa fase, como um toque de mágica."]} nameImage={"image8.png"}/>

            <Card title={"Como tornar a magia real"} index={"3"}  titleButton={"VER MATERIAIS"} textList={["Durante todo o período de quarentena, estamos à total disposição de cada um de vocês, clientes.O COVID-19 chegou desestabilizando o país e trazendo consigo uma grande incógnita quanto a proporção disso no país, nas pessoas e principalmente, na economia.", "Nosso compromisso com você durante essa fase, é para assegurar que o seu negócio seja o  menos afetado possível, mantendo sua base de clientes fidelizados sólida e segura!"]} nameImage={"image8.png"}/>

            <Card title={"Conheça alguns clientes que compartilharam suas experiências"} index={"4"}  titleButton={"VER MAIS"} textList={["Durante todo o período de quarentena, estamos à total disposição de cada um de vocês, clientes.O COVID-19 chegou desestabilizando o país e trazendo consigo uma grande incógnita quanto a proporção disso no país, nas pessoas e principalmente, na economia.", "Nosso compromisso com você durante essa fase, é para assegurar que o seu negócio seja o  menos afetado possível, mantendo sua base de clientes fidelizados sólida e segura!"]} nameImage={"image8.png"}/>

        </div>
    );
}

export default Main;
